# PROGRAMA                                                                                                        
                                                                                                                                                                                                                                                                                                                                    
.text 

main:

# Parametros globais:
	
	addi $25 $0 128 # quantidade de colunas do cenario
	addi $30 $0 64 # quantidade de linhas do cenario
	mul $26 $25 $30 # area do cenario
	addi $27 $0 33910 # assets + vetor 
	addi $6 $0 512 # width do display
	addi $7 $0 4 # porporcao width do display
	
# Chamada de funcao para guardar cenario, personagens e vetores na memoria
	add $10, $27, $26 # contador da iteracao
	add $8 $0 $10
	sll $8 $8 2
	addi $8 $8 0x10010000
	addi $8 $8 -4 # local a ser lido
	add $24 $0 $10
	sll $24 $24 2
	add $24 $24 $8 
	sll $1 $27 2
	sub $24 $24 $1 # local a ser armazenado
	jal store

# carrega tela inicial do jogo
menu:
	lui $8, 0x1001 # local a ser escrito
	add $24 $0 135640
	add $24 $24 $8 # local a ser lido
	addi $10, $0, 0 # contador
	jal load
menuoptions:
	lui $8, 0xffff # tecla foi digitada
	lw $11, 0($8)
	beq $11, $0, menuoptions # se != 0 digitou algo
	lw $13, 4($8) # tecla digitada pelo usuario
	addi $12, $0, 's'
	beq $12, $13, start # se for s 
	addi $12, $0, 'c'
	beq $12, $13, comands # se for c
	addi $12, $0, 'e'
	beq $12, $13, exit # se for e
	j menuoptions
	
# carrega tela com comandos do jogo
comands:
	lui $8, 0x1001 # local a ser escrito
	add $24 $0 168408
	add $24 $24 $8 # local a ser lido
	addi $10, $0, 0 # contador
	jal load
comandoptions:
	lui $8, 0xffff # tecla foi digitada
	lw $11, 0($8)
	beq $11, $0, comandoptions # se != 0 digitou algo
	lw $13, 4($8) # tecla digitada pelo usuario
	addi $12, $0, 'b'
	beq $12, $13, menu # se for b
	j comandoptions

exit:
	lui $9 0x1001
	addi $11 $0 0
	addi $12 $0 0
startexit:
	beq $12 8192 endexit
	sw $11 0($9)
	addi $9 $9 4
	addi $12 $12 1
	j startexit
endexit:
	j end
	
	
cenario:
	
# Chamada de funcao para carregar cenario na tela
	lui $8, 0x1001 # local a ser escrito
	add $24 $0 $26
	sll $24 $24 2
	add $24 $24 $8 # local a ser lido
	addi $10, $0, 0 # contador
	jal load
	
# Ponteiros para vetores dos personagens 
	lui $2 0x1001
	addi $1 $0 70072 # personagem1[0]
	add $2 $2 $1
	
	lui $3 0x1001
	addi $1 $0 70008 # personagem2[0]
	add $3 $3 $1
	
	lui $4 0x1001
	addi $1 $0 70040 # personagem3[0]
	add $4 $4 $1
	
	lui $5 0x1001
	addi $1 $0 69976 # personagem4[0]
	add $5 $5 $1
	
# loop da animacao da tela:
	# desenha personagens
	# verifica colisao 
	# aguarda um tempo
	# apaga personagens 
	# movimenta personagens
animacao:
	bne  $0, $0, fimanimacao # comparacao de posicao
	
# carregamento de parametros do personagem 1: protagonista
	lw $22 0($2) # base  
	lw $23 4($2) # altura 
	lw $18 8($2) # x inicial
	lw $19 12($2) # y inicial
	lw $20 16($2) # x final
	lw $21 20($2) # y final
	lw $28 24($2) # inicio 
	lw $29 28($2) # extra
	
# chamada de funcao para carregar personagem na tela 
	addi $8 $0 0x10010000
	add $8 $8 $28 # endereco do inicio do personagem na memoria
	add $9, $0, $22 # base (colunas do desenho)
	add $10, $0, $23 # altura (linhas do desenho)
	add $11, $0, $18 # x
	add $12, $0, $19 # y
	jal personagem
	
# carregamento de parametros de personagem 2: npc
	lw $22 0($3) # base  
	lw $23 4($3) # altura 
	lw $18 8($3) # x inicial
	lw $19 12($3) # y inicial
	lw $20 16($3) # x final
	lw $21 20($3) # y final
	lw $28 24($3) # inicio
	lw $29 28($3) # extra
	
# chamada de funcao para carregar personagem na tela 
	addi $8 $0 0x10010000
	add $8 $8 $28 # endereco do inicio do personagem na memoria
	add $9, $0, $22 # base (colunas do desenho)
	add $10, $0, $23 # altura (linhas do desenho)
	add $11, $0, $18 # x
	add $12, $0, $19 # y
	jal personagem
	
# carregamento de parametros de personagem 3: npc
	lw $22 0($4) # base  
	lw $23 4($4) # altura 
	lw $18 8($4) # x inicial
	lw $19 12($4) # y inicial
	lw $20 16($4) # x final
	lw $21 20($4) # y final
	lw $28 24($4) # inicio
	lw $29 28($4) # extra
	
# chamada de funcao para carregar personagem na tela 
	addi $8 $0 0x10010000
	add $8 $8 $28 # endereco do inicio do personagem na memoria
	add $9, $0, $22 # base (colunas do desenho)
	add $10, $0, $23 # altura (linhas do desenho)
	add $11, $0, $18 # x
	add $12, $0, $19 # y
	jal personagem
	
# carregamento de parametros de personagem 4: npc
	lw $22 0($5) # base  
	lw $23 4($5) # altura 
	lw $18 8($5) # x inicial
	lw $19 12($5) # y inicial
	lw $20 16($5) # x final
	lw $21 20($5) # y final
	lw $28 24($5) # inicio
	lw $29 28($5) # extra
	
# chamada de funcao para carregar personagem na tela 
	addi $8 $0 0x10010000
	add $8 $8 $28 # endereco do inicio do personagem na memoria
	add $9, $0, $22 # base (colunas do desenho)
	add $10, $0, $23 # altura (linhas do desenho)
	add $11, $0, $18 # x
	add $12, $0, $19 # y
	jal personagem
	
# testes de colisao

# colisao protagonista e porta or

	lw $22 0($2) # base 1  
	lw $23 4($2) # altura 1 
	lw $18 8($2) # x1 inicial
	lw $19 12($2) # y1 inicial 
	lw $20 0($5) # base 2
	lw $21 4($5) # altura 2
	lw $28 8($5) # x2 inicial
	lw $29 12($5) # y2 inicial
	
	jal colisao
	
# colisao protagonista e porta and

	lw $22 0($2) # base 1  
	lw $23 4($2) # altura 1 
	lw $18 8($2) # x1 inicial
	lw $19 12($2) # y1 inicial 
	lw $20 0($3) # base 2
	lw $21 4($3) # altura 2
	lw $28 8($3) # x2 inicial
	lw $29 12($3) # y2 inicial
	
	jal colisao
	
# colisao protagonista e porta not

	lw $22 0($2) # base 1  
	lw $23 4($2) # altura 1 
	lw $18 8($2) # x1 inicial
	lw $19 12($2) # y1 inicial 
	lw $20 0($4) # base 2
	lw $21 4($4) # altura 2
	lw $28 8($4) # x2 inicial
	lw $29 12($4) # y2 inicial
	
	jal colisao
	
	
# tempo de espera da animacao
	addi $8, $0, 5000 # taxa de tempo de espera
	jal timer
	
# apagar persoangens da tela
pers1:	

# carregamento de parametros do personagem 1: protagonista
	lw $22 0($2) # base  
	lw $23 4($2) # altura 
	lw $18 8($2) # x inicial
	lw $19 12($2) # y inicial
	lw $20 16($2) # x final
	lw $21 20($2) # y final
	lw $28 24($2) # inicio
	lw $29 28($2) # extra

# teste para colisao com bandeira
flagcolision:	
	blt $18 117 continue
	blt $19 40 continue
	j win 
continue:

# chamada de funcao para apagar personagem
	add $9, $0, $22 # base (colunas do desenho)
	add $10, $0, $23 # altura (linhas do desenho)
	add $11, $0, $18 # x do canto superior esquerdo
	add $12, $0, $19 # y do canto superior esquerdo
	jal carregafundo
	

# controle manual de personagem:	
controle:
	lui $8, 0xffff # tecla foi digitada
	lw $11, 0($8)
	beq $11, $0, naodig # se != 0 digitou algo
	addi $12, $0, 'd'
	lw $13, 4($8) # tecla digitada pelo usuario
	beq $12, $13, dir # se for d 
	addi $12, $0, 'a'
	beq $12, $13, esq # se for a
	addi $12, $0, 's'
	beq $12, $13, baixo # se for s
	addi $12, $0, 'w'
	beq $12, $13, cima # se for w 
	addi $12, $0, ' '
	beq $12, $13, pular # se for ' '
	addi $12 $0 'm'
	beq $12, $13, menu # se for m
	j naodig
	
# caso queira alterar a velocidade do movimento aumente os valores
dir:  	
	bge $18 118 fimpers1 	
	addi $18, $18, 3 # incrementa endereco pra direita
	lw $28 24($2) # inicio 
	beq $28 67384 corredir # +0 
	beq $28 68248 andadir # +432
	addi $28 $0 67384 # -864
	j fimdir
andadir:
	addi $28 $0 67816 # +432
	j fimdir 
corredir:
	addi $28 $0 68248 # +432
	j fimdir 
fimdir:	
	sw $28 24($2) # inicio
	j naodig
esq: 	#68680 69112 69544
	blt $18 1 fimpers1 
	addi $18, $18, -3 # incrementa endereco pra esquerda
	lw $28 24($2) # inicio 
	beq $28 68680 correesq # +0 
	beq $28 69544 andaesq # +432
	addi $28 $0 68680 # -864
	j fimesq
andaesq:
	addi $28 $0 69112 # +432
	j fimesq 
correesq:
	addi $28 $0 69544 # +864
	j fimesq 
fimesq:	
	sw $28 24($2) # inicio
	j naodig
baixo: 	
	bgt $19 50 fimpers1 
	#addi $19, $19, 3 # incrementa endereco pra baixo 
	#lw $28 24($2) # inicio 
	#addi $28 $0 67816
	#sw $28 24($2) # inicio
	j naodig
cima:	
	blt $19 2 fimpers1 
	#addi $19, $19, -3 # incrementa endereco pra cima
	#lw $28 24($2) # inicio 
	#addi $28 $0 68248
	#sw $28 24($2) # inicio  
	j naodig
pular: 
	bgt $29 $0 naodig
	addi $29 $0 48
	
naodig:
	# aqui pode-se fazer algo quando n�o h� entrada de teclas

# personagem pula	
pulo:	
	ble $29 $0 fimpers1
	blt $19 1 fimpers1 
	addi $29 $29 -3
	addi $19, $19, -3 # incrementa endereco pra cima
	lw $28 24($2) # inicio
	ble $28 68248 pulodir
	addi $28 $0 69544
	j fimpulo
pulodir:	
	addi $28 $0 68248
fimpulo:
	sw $28 24($2) # inicio
	
# continua para o proximo personagem
fimpers1:
	blt $18 118 margem
	addi $18 $0 119
margem:
	j gravidade

# funcao que verifica colisao de personagens
	# parametros
	# $22 base 1  
	# $23 altura 1 
	# $18 x1 inicial
	# $19 y1 inicial 
	# $20 base 2
	# $21 altura 2
	# $28 x2 inicial
	# $29 y2 inicial
colisao:
	add $22 $22 $18 # x1 final
	add $23 $23 $19 # y1 final
	add $20 $20 $28 # x2 final
	add $21 $21 $29 # y2 final
	
	bgt $28 $22 endcolisao
	bgt $18 $20 endcolisao
	bgt $29 $23 endcolisao
	bgt $19 $21 endcolisao
	j lose
endcolisao:
	jr $31
 	
gravidade:
	bgt $19 45 endgravidade 
	addi $19, $19, 1 # incrementa endereco pra baixo
endgravidade:
 

# armazenamento de parametros do personagem 1: protagonista
	sw $22 0($2) # base  
	sw $23 4($2) # altura 
	sw $18 8($2) # x inicial
	sw $19 12($2) # y inicial
	sw $20 16($2) # x final
	sw $21 20($2) # y final
	sw $28 24($2) # inicio
	sw $29 28($2) # extra
	
pers2:

# carregamento de parametros de personagem 2: npc
	lw $22 0($3) # base  
	lw $23 4($3) # altura 
	lw $18 8($3) # x inicial
	lw $19 12($3) # y inicial
	lw $20 16($3) # x final
	lw $21 20($3) # y final
	lw $28 24($3) # inicio
	lw $29 28($3) # extra
	
# chamada de funcao para apagar personagem
	add $9, $0, $22 # base (colunas do desenho)
	add $10, $0, $23 # altura (linhas do desenho)
	add $11, $0, $18 # x do canto superior esquerdo
	add $12, $0, $19 # y do canto superior esquerdo
	jal carregafundo
	
# controle automatico de movimento de personagem
ida2:	beq $18, $20 troca2 # troca x inicial e final
	bgt $18, $20 volta2 # loop da ida
	addi $28 $0 66152 # direita
	addi $18, $18, 1 # variacao do movimento
	j fimpers2
