	blt $18 $20 ida2 # loop da volta
	addi $28 $0 66460 # esquerda
	addi $18, $18, -1 # variacao do movimento
fimpers2:
	
# armazenamento de parametros do personagem 2: npc
	sw $22 0($3) # base  
	sw $23 4($3) # altura 
