	add $20 $0 $29 # x final = x inicial
	add $29 $0 $18 # extra = x final
	j fimpers4
volta4:	
	blt $18 $20 ida4 # loop da volta
	addi $28 $0 65844 # esquerda
	addi $18, $18, -1 # variacao do movimento
fimpers4:
	
# armazenamento de parametros do personagem 3: npc
	sw $22 0($5) # base  
	sw $23 4($5) # altura 
	sw $18 8($5) # x inicial
	sw $19 12($5) # y inicial
	sw $20 16($5) # x final
	sw $21 20($5) # y final
	sw $28 24($5) # inicio
	sw $29 28($5) # extra

pers5:

	# aqui pode-se incrementar mais personagens no jogo
	
	j animacao

fimanimacao:
	
end:
	addi $2, $0, 10 # encerra o programa
	syscall
	
# funcao para carregar cenario na tela
# paramentros:
	# local a ler $24
	# local a escrever $8
	# contador $10
load:	
	lw $9, 0($24)
	sw $9, 0($8)
	addi $8, $8, 4
	addi $24, $24, 4
	addi $10, $10, 1
	bne $10, $26, load
	jr $31
	
# funcao para guardar cenario e personagem na memoria
# paramentros:
	# local a ser lido $8
	# local a ser armazenado $24
	# contador $10
store:
	lw $9, 0($8)
	sw $9, 0($24)
	addi $8, $8, -4
	addi $24, $24, -4
	addi $10, $10, -1
	bne $10, 0, store
	jr $31

# funcao para desenhar personagem na tela
# parametros:
	# endereco inicial: $8 
	# Largura do personagem: $9
	# altura do personagem: $10
	# Saber o x: $11
	# Saber o y: $12
personagem:  
	lui $15, 0x1001
	sll $11, $11, 2 # enderecos a percorrer no eixo x
	div $6 $7 # width / proporcao
	mflo $1
	sll $1 $1 2 # enderecos a percorrer no eixo y
	mul $12, $12, $1 
	add $15, $15, $11
	add $15, $15, $12 # posicao inicial a ser desenhada
	add $13, $0, $9 # quantidade de colunas
laco1:	beq $10, $0, fimlaco1
laco2:	beq $9, $0, fimlaco2
	lw $14, 0($8) # local a ler
	beq $14 1 notWrite
	sw $14, 0($15) # local a desenhar.
notWrite:
	addi $8, $8, 4 
	addi $15, $15, 4
	addi $9, $9, -1 # colunas--
	j laco2
fimlaco2:   
	div $6 $7 # width / proporcao
	mflo $1
	sll $1 $1 2 # enderecos a percorrer no eixo y
	add $15, $15, $1
	sll $16, $13, 2 
	sub $15, $15, $16 # volta para a coluna inicial
	add $9, $0, $13 # valor inicial de colunas 
	addi $10, $10, -1 # linhas--  
	j laco1  
fimlaco1: 
	jr $31
            
# funcao para carregar parte do cenario.
# parametros: 
	# Largura do personagem: $9
	# altura do personagem: $10
	# Saber o x: $11
	# Saber o y: $12
carregafundo:  
	lui $15, 0x1001
	sll $11, $11, 2 # enderecos a percorrer no eixo x
	div $6 $7 # width / proporcao
	mflo $1
	sll $1 $1 2 # enderecos a percorrer no eixo y
	mul $12, $12, $1 
	add $15, $15, $11
	add $15, $15, $12 # posicao inicial a ser desenhada
	add $13, $0, $9 # quantidade de colunas        
	lui $8, 0x1001 
	add $8, $8, $11
	add $8, $8, $12 # posicao inicial a ser desenhada
	add $12, $0, $26
	sll $12, $12, 2
	add $8, $8, $12
	    
laco1.1:
	beq $10, $0, fimlaco1.1
laco2.1:
	beq $9, $0, fimlaco2.1
	lw $14, 0($8) # local a ler
	sw $14, 0($15) # local a desenhar.
	addi $8, $8, 4 
	addi $15, $15, 4
	addi $9, $9, -1 # colunas--
	j laco2.1
fimlaco2.1:    
	div $6 $7 # width / proporcao
	mflo $1
	sll $1 $1 2 # enderecos a percorrer no eixo y
	add $15, $15, $1
	add $8, $8, $1
	sll $16, $13, 2 
	sub $8, $8, $16 # volta para a coluna inicial
	sub $15, $15, $16 
	add $9, $0, $13 # valor inicial de colunas
	addi $10, $10, -1 # linahs--  
	j laco1.1  
fimlaco1.1: 
	jr $31
	
# funcao para passar tempo.
# parametros:
	# taxa de espera: $8          
timer:	
	beq $8, $0, fimtimer
	nop
	nop
	nop
	nop
	nop
	nop
	nop
	nop
	nop
	nop
	addi $8, $8, -1
	j timer
fimtimer: 
	jr $31
 
win:
	lui $10 0x1001
	addi $9 $0 102872 # tela survivor
	add $9 $9 $10
	addi $12 $0 8192		
survive:	
	beq $12 $0 endsurvive
	lw $11 0($9)
	addi $8 $0 15
	jal timer
	sw $11 0($10)
	addi $9 $9 4
	addi $10 $10 4
	addi $12 $12 -1
	j survive
endsurvive:
	j reset
lose:
	lui $10 0x1001
	addi $9 $0 70104 # tela game over
	add $9 $9 $10
	addi $12 $0 8192		
gameover:	
	beq $12 $0 endlose
	lw $11 0($9)
	addi $8 $0 30
	jal timer
	sw $11 0($10)
	addi $9 $9 4
	addi $10 $10 4
	addi $12 $12 -1
	j gameover
endlose:
	
reset:
	lui $8, 0xffff # tecla foi digitada
	lw $11, 0($8)
	beq $11, $0, reset # se != 0 digitou algo
	lw $13, 4($8) # tecla digitada pelo usuario
	addi $12, $0, 'r'
	beq $12, $13, menu # se for r 
	addi $12, $0, 'e'
	beq $12, $13, exit # se for e
	j reset
	
start:
	# Parametros globais:
	
	addi $25 $0 128 # quantidade de colunas do cenario
	addi $30 $0 64 # quantidade de linhas do cenario
	mul $26 $25 $30 # area do cenario
	addi $27 $0 9334 # assets + vetor 
	addi $6 $0 512 # width do display
	addi $7 $0 4 # porporcao width do display
	
	addi $18 $0 15 # x inicial
	addi $19 $0 46 # y inicial
	
	lui $2 0x1001
	addi $1 $0 70072 # personagem4[0]
	add $2 $2 $1
	
	sw $18 8($2) # x inicial
	sw $19 12($2) # y inicial
	addi $29 $0 0 # extra
	sw $29 28($2) # extra
	j cenario
 	
	
